  spoken_languages: [{
    iso_639_1: { type: String },
    name: { type: String }
  }],
  status: { type: String },
  tagline: { type: String }
});

MovieSchema.statics.findByMovieDBId = function (id) {
  return this.findOne({ id: id });
};

export default mongoose.model('Movies', MovieSchema);

import fetch from "node-fetch";

export const getUpcomingMovies = async () => {
  const response = await fetch(
    `https://api.themoviedb.org/3/movie/upcoming?api_key=${process.env.TMDB_KEY}&language=en-US&page=1`
  );

  if (!response.ok) {
    throw new Error(response.json().message);
  }

  return await response.json();
};

export const getGenres = async () => {
  const response = await fetch(
    `https://api.themoviedb.org/3/genre/movie/list?api_key=${process.env.TMDB_KEY}&language=en-US&page=1`
  );

  if (!response.ok) {
    throw new Error(response.json().message);
  }

  return await response.json();
};

import express from "express";
import User from "./userModel";
import asyncHandler from "express-async-handler";
import jwt from "jsonwebtoken";

const validatePassword = (password) => {
  const regex =
    /^(?=.*[A-Za-z])(?=.*\d)(?=.*[@$!%*#?&])[A-Za-z\d@$!%*#?&]{8,}$/;
  return regex.test(password);
};

const router = express.Router(); // eslint-disable-line

// Get all users
router.get("/", async (req, res) => {
  const users = await User.find();
  res.status(200).json(users);
});

// register(Create) User
router.post(
  "/",
  asyncHandler(async (req, res) => {
    try {
      if (!req.body.username || !req.body.password) {
        return res
          .status(400)
          .json({ success: false, msg: "Username and password are required." });
      } else if (!validatePassword(req.body.password)) {
        return res.status(400).json({
          success: false,
          msg: "Password does not meet the requirements",
        });
      }
      if (req.query.action === "register") {
        await registerUser(req, res);
      } else {
        await authenticateUser(req, res);
      }
    } catch (error) {
      // Log the error and return a generic error message
      console.error(error);
      res.status(500).json({ success: false, msg: "Internal server error." });
    }
  })
);

// Update a user
router.put("/:id", async (req, res) => {
  if (req.body._id) delete req.body._id;
  const result = await User.updateOne(
    {
      _id: req.params.id,
    },
    req.body
  );
  if (result.matchedCount) {
    res.status(200).json({ code: 200, msg: "User Updated Sucessfully" });
  } else {
    res.status(404).json({ code: 404, msg: "Unable to Update User" });
  }
});

async function registerUser(req, res) {
  // Add input validation logic here
  await User.create(req.body);
  res.status(201).json({ success: true, msg: "User successfully created." });
}

async function authenticateUser(req, res) {
  const user = await User.findByUserName(req.body.username);
  if (!user) {
    return res
      .status(401)
      .json({ success: false, msg: "Authentication failed. User not found." });
  }

  const isMatch = await user.comparePassword(req.body.password);
  if (isMatch) {
    const token = jwt.sign({ username: user.username }, process.env.SECRET);
    user._id, res.status(200).json({ success: true, token: "BEARER " + token });
  } else {
    res.status(401).json({ success: false, msg: "Wrong password." });
  }
}
export default router;

